import React from 'react';
import "react-image-gallery/styles/css/image-gallery.css";
import Gallery from 'react-image-gallery';

function ImageSlider() {
  const images = [
    {
      original: 'one.jpg',
      thumbnail: 'one.jpg',
      description: 'Image 1',
    },
    {
      original: 'two.jpg',
      thumbnail: 'two.jpg',
      description: 'Image 2',
    },
    {
      original: 'three.jpg',
      thumbnail: 'image3-thumbnail.jpg',
      description: 'Image 3',
    },
  ];

  return (
    <div>
      <Gallery items={images} />
    </div>
  );
}

export default ImageSlider;
